import React from "react";
import { Link, NavLink } from "react-router-dom";

function Genere() {
  return (
    <div>
      <ul className="nav genere-list">
        <li>
          <Link
            className={(Link) => (Link.isActive ? "active" : "")}
            to="/home/Comedy"
          >
            comedy
          </Link>
        </li>
        <li>
          <Link
            className={(Link) => (Link.isActive ? "active" : "")}
            to="/home/Horror"
          >
            Horror
          </Link>
        </li>
        <li>
          <Link
            className={(Link) => (Link.isActive ? "active" : "")}
            to="/home/Romance"
          >
            Romance
          </Link>
        </li>
      </ul>
    </div>
  );
}

export default Genere;
